import logo from './images/logo.svg';
import menu from './images/icons8-menu.svg';

const Navbar = () => {
    return (
        <nav className='px-8 py-12 flex justify-between'>
            <img 
            className=''
            src={logo} 
            alt="logo"/>
            <img src={menu} alt="navbar"/>
        </nav>
    );
}

export default Navbar;
